import React from 'react';
import {Route} from 'react-router-dom';

import './contact.css';
import Navbar from '../../components/navbar/navbar';


const Contact = () => {
	return(
		<div className='contactdiv'>
		<Navbar />
		<h1 className='contacttitle'>CONTACT US</h1>
		<h2>Instagram</h2>
		<h2>Facebook</h2>
		<h2>...@yahoo.com</h2>
		<h2>0748393748</h2>
		</div>
		);
}

export default Contact;
